import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Avatar from '@material-ui/core/Avatar';
import { deepOrange} from '@material-ui/core/colors';
import {background,background_container,avatar,updatebutton} from '../Styles/Background.module.scss';
import IconButton from '@material-ui/core/IconButton';
import CreateOutlinedIcon from '@material-ui/icons/CreateOutlined';

//import {avatar} from '../Styles/Avatar.module.scss';

const useStyles = makeStyles((theme) => ({
  default: {
    fontSize:theme.spacing(7),
    color: theme.palette.getContrastText(deepOrange[500]),
    backgroundColor: deepOrange[500],
    width: theme.spacing(10),
    height: theme.spacing(10),
  },
}));

export default function LetterAvatars() {
  const classes = useStyles();

  return (
    <div className={background}>
      <div className={background_container}>
        <Avatar className={classes.default+" "+avatar}>
          q
        </Avatar>
        <IconButton className={updatebutton}>
          <CreateOutlinedIcon />
        </IconButton>
      </div>
    </div>
    
  );
}
